import Header from './components/header/Header';
import "./index.css"

function App() {
  return (
    <menu>
      <div className="game-container">
        <ol id="players">
          <li>Player 1</li>
          <li><span>Player symbol <b>X</b></span></li>   
          <li>Player 2</li>
          <li><span>Player symbol <b>O</b></span></li>
        </ol>
      </div>

    </menu>

  );
}

export default App;
